template <class T, class Func>
void CheckSimulate(const std::vector<GameStep>& steps, bool check_over, Func&& init) {
  T game;
  init(game, steps[0].piece, steps[1].piece);
  for (size_t i = 0; i < steps.size(); i++) {
    int next_piece = i == steps.size() - 1 ? 0 : steps[i + 1].piece;
    game.SetNextPiece(next_piece);
    auto result = game.InputPlacement(steps[i].pos, 0);
    ASSERT_NE(result.first, -1);
    ASSERT_EQ(result.second, steps[i].lines);
  }
  if (check_over) {
    ASSERT_TRUE(game.IsOver());
  }
}

class GameTest : public ::testing::Test {
 protected:
  void SetUp() {}
  void TearDown() override {}
};

TEST_F(GameTest, TestNormalGames) {
  SetUp();
  for (auto& game : kNormalGames) {
    CheckSimulate<Tetris>(game, true, [](Tetris& game, int first_piece, int second_piece) {
      game.Reset(Board::Ones, 0, first_piece, second_piece);
    });
  }
}

TEST_F(GameTest, TestPerfectGames) {
  SetUp();
  for (auto& game : kPerfectGames) {
    CheckSimulate<Tetris>(game, false, [](Tetris& game, int first_piece, int second_piece) {
      game.Reset(Board::Ones, 0, first_piece, second_piece);
    });
  }
}

TEST_F(GameTest, TestNoroGames) {
  SetUp();
  for (auto& game : kNoroGames) {
    CheckSimulate<TetrisNoro>(game, false, [](TetrisNoro& game, int first_piece, int second_piece) {
      game.Reset(Board::Ones, 0, 0, true, first_piece, second_piece);
    });
  }
}
